import $ from "jquery";

$(document).ready(function() {
  var ammount = 0;
  $.ajax({
    type: "GET",
    url: "http://localhost:4242/api/1.0/length",
    dataType: "json",
    success: function(response) {
      ammount = response.length;
      for (var i = 0; i < ammount; i++) {
        $.ajax({
          type: "POST",
          url: "http://localhost:4242/api/1.0/get",
          dataType: "json",
          async: false,
          data: {
            itteration: i
          },
          success: function(response) {
            console.log(response);
            if(response.level == 1){
                $(".grid-container").append(
                    $('<div class="grid-item-1">').append(
                      $('<img class="thumbnail" src="data:image/png;base64,' + response.thumbnail + '">')
                    )
                  );
            }
            $(".grid-container").append(
              $('<div class="grid-item-2">').append(
                $('<img class="thumbnail" src="data:image/png;base64,' + response.thumbnail + '">')
              )
            );
          },
          error: function() {}
        });
      }
    },
    error: function() {}
  });
});
